package domain;

public class Member {
	private int mNo;
	private String mId;
	private String mName;
	private String mPassword;
	private String mTel;
	private String mEmail;
	private int mBirth;
	private String mImg;
	private String mTempPassword;
	private String mRemoveDate;
	private int mIfactive;
	
	public Member() {
		// TODO Auto-generated constructor stub
	}

	public int getmNo() {
		return mNo;
	}

	public void setmNo(int mNo) {
		this.mNo = mNo;
	}

	public String getmId() {
		return mId;
	}

	public void setmId(String mId) {
		this.mId = mId;
	}

	public String getmName() {
		return mName;
	}

	public void setmName(String mName) {
		this.mName = mName;
	}

	public String getmPassword() {
		return mPassword;
	}

	public void setmPassword(String mPassword) {
		this.mPassword = mPassword;
	}

	public String getmTel() {
		return mTel;
	}

	public void setmTel(String mTel) {
		this.mTel = mTel;
	}

	public String getmEmail() {
		return mEmail;
	}

	public void setmEmail(String mEmail) {
		this.mEmail = mEmail;
	}

	public int getmBirth() {
		return mBirth;
	}

	public void setmBirth(int mBirth) {
		this.mBirth = mBirth;
	}

	public String getmImg() {
		return mImg;
	}

	public void setmImg(String mImg) {
		this.mImg = mImg;
	}

	public String getmTempPassword() {
		return mTempPassword;
	}

	public void setmTempPassword(String mTempPassword) {
		this.mTempPassword = mTempPassword;
	}

	public String getmRemoveDate() {
		return mRemoveDate;
	}

	public void setmRemoveDate(String mRemoveDate) {
		this.mRemoveDate = mRemoveDate;
	}

	public int getmIfactive() {
		return mIfactive;
	}

	public void setmIfactive(int mIfactive) {
		this.mIfactive = mIfactive;
	}
	
}
